result:
ID: RunSQLQuery
Inputs: query
Outputs: result
Completion type: EXPLICIT
Reactive inputs: None

function ({query}, {result}, {externalContext}) {
  const { database } = externalContext;
  database.query(query, (error, data) => {
    if (error) {
      result.error(error);
    } else {
      result.next(data);
    }
  });
}
